import Vue from "vue";
import Router from "vue-router";
Vue.use(Router);

import NoteAdd from '../components/NoteAdd.vue'
import NotesList from '../components/NotesList.vue'

export default new Router({
    routes : [
        {
            path: "/add-note",
            name: "NoteAdd",
            component: NoteAdd
        },
        {
            path: "/list-notes",
            name: "NoteList",
            component: NotesList
        }
    ]
})
